import { Table, Layout, Space, Row, Col} from "antd";
import "./App.less";
import React from "react";

const { Header, Footer, Sider, Content } = Layout;

function App() {

  return (
    <div className="App">     
    <Layout style={{}}>
      <Space>
      <Sider width="200" style={{background: 'white'}}>
      사이더
        <Layout>          
          <Row style={{background: 'red'}}>카운터자리(원)</Row>
          <Row style={{background: 'blue', color: 'white'}}>구단명자리(테이블)</Row>
        </Layout>
      </Sider>
      <Layout>
        <Space direction="vertical">
        <Header style={{background: 'green'}}>현재선택선수정보자리</Header>
        <Content style={{width: '1200px', background: 'black', color: 'white'}}>선수명단자리(테이블)<br></br><br></br><br></br><br></br><br></br></Content>        
        </Space>
      </Layout>
      <Sider width="100" style={{background: 'orange'}}>
      사이더
      <Row style={{background: 'red'}}>선택된선수자리(테이블)</Row>
      </Sider>
      </Space>
    </Layout>  
    </div>
  );
}
export default App;
